def update(i):
    for _ in range(iterations_per_frame):
        x, y = random.randint(0,size-1), random.randint(0,size-1)
        
        C = Lattice[y][x]
        N = Lattice[(y-1)%size][x]
        E = Lattice[y][(x+1)%size]
        S = Lattice[(y+1)%size][x]
        W = Lattice[y][(x-1)%size]

        H = (C==N) + (C==E) + (C==S) + (C==W) # low H corresponds to high energy
        if H < 1:
            Lattice[y][x] *= -1
        elif random.uniform(0,1) < 2**(-4*(H-2)):
            Lattice[y][x] *= -1
        
        # if Lattice[y][x] == -1:
        #     if random.uniform(0,1) < 0.1:
        #         Lattice[y][x] *= -1

    for a in range(size):
        for b in range(size):
            if Lattice[a][b] == 1:
                Image[a][b] = dark_gray
            else:
                Image[a][b] = light_gray

    plt.imshow(Image)

    fileName = 'VideoFrames/frame'+(int(np.log10(frames)) - int(np.log10(i)))*'0'+str(i)+'.jpg'
    plt.savefig(fileName)

